•	Fornecimento de 02 (dois) equipamentos de registro eletrônico de ponto (REP), em conformidade com a Portaria MTP nº 671/2021 e devidamente certificados pelo Inmetro, dotados de:
o	Identificação por biometria digital;
o	Leitor de cartão de proximidade;
o	Identificação por senha;
o	Display touchscreen colorido sensível ao toque;
o	Comunicação via TCP/IP e/ou USB;
o	Impressão de comprovante de marcação;
o	Capacidade mínima de armazenamento de 5.000 digitais;
o	Memória inviolável conforme exigências da legislação vigente;
o	Fonte de alimentação bivolt automática (110/220V);
o	Dimensões e estrutura adequadas ao uso institucional, com suporte a instalação em parede ou balcão.
•	Serviço de instalação e configuração dos equipamentos, com disponibilização de técnico responsável, bem como treinamento básico para utilização e operação do sistema.
•	Licença de uso de software de gestão de ponto eletrônico, com as seguintes características:
o	Plataforma baseada em nuvem (cloud computing), com acesso por navegador web e aplicativo mobile (Android e iOS);
o	Integração automática com os equipamentos fornecidos, com sincronização em tempo real;
o	Permissão de uso para até 100 colaboradores e 01 CNPJ;
o	Controle de jornada com regras flexíveis de cálculo (banco de horas, horas extras, folgas, feriados, etc.);
o	Geração de relatórios customizáveis;
o	Interface intuitiva para gestores e usuários;
o	Acesso multiusuário com diferentes níveis de permissão;
o	Compatibilidade com exportação de dados para sistemas de folha de pagamento;
o	Suporte técnico remoto ilimitado (via telefone, e-mail ou acesso remoto);
o	Atualizações automáticas de sistema, sem custo adicional.
•	Condições adicionais:
o	Garantia mínima de 12 (doze) meses para os equipamentos, conforme condições do fabricante;
o	Entrega em até 05 (cinco) dias úteis após a formalização da contratação;
o	Frete incluso;
o	Suporte técnico remoto durante todo o período de vigência contratual da licença de software.

